import React from 'react';
import { View, Text, StyleSheet, FlatList } from 'react-native';

const ListScreen = () => {
    const friends = [
        { name: 'Friend #1', key: '1' },
        { name: 'Friend #2', key: '1' },
        { name: 'Friend #3' , key: '1'},
        { name: 'Friend #4', key: '1' },
        { name: 'Friend #5', key: '1' },
        { name: 'Friend #6', key: '1' },
        { name: 'Friend #7', key: '1' },
        { name: 'Friend #8', key: '1'},
        { name: 'Friend #9', key: '1'},
    ]
    return (
        <FlatList 
            data={friends} 
            renderItem={({item}) => {
                return <Text>{item.name}</Text>
            }} />
    )
    
}

const styles = StyleSheet.create({

})

export default ListScreen;
